import React, { useEffect, useState } from "react";
import api from "../../axiosConfig";
import "./UserDashboard.css";
import "./ViewStatus";
import "./SubmittedFeedbacks";
import { useNavigate } from "react-router-dom";
import { FaTrash } from "react-icons/fa";

const UserDashboard = () => {
  const navigate = useNavigate();
  const [feedbacks, setFeedbacks] = useState([]);
  const [view, setView] = useState("submitted"); // default view

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/UserLogin");
      return;
    }
  }, []);

  const fetchFeedbacks = async () => {
    try {
      const res = await api.get("Feedback/my-feedbacks");
      setFeedbacks(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  //Handle delete feedbacks
  const handleDelete = async (id) => {
    if (alert("Are you sure you want to delete this feedback?")) return;
    try {
      await api.delete(`Feedback/delete/${id}`);
      setFeedbacks(feedbacks.filter(f => f.id !== id));
      alert("Feedback deleted successfully!");
    } catch (err) {
      console.error(err);
      alert("Failed to delete feedback.");
    }
  };

  return (
    <div className="dashboard-container">

      {/* ----------- CONTENT ONLY (Header Removed) ----------- */}
      <main className="dashboard-content">
        {view === "recent" && (
          <div>
            <h3>Recent Feedback Status</h3>
            <table>
              <thead>
                <tr>
                  <th>Mentor</th>
                  <th>Week</th>
                  <th>Submitted On</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                {feedbacks.slice(-5).reverse().map(f => (
                  <tr key={f.id}>
                    <td>{f.mentorName}</td>
                    <td>{f.week}</td>
                    <td>{f.submittedOn ? new Date(f.submittedOn).toLocaleDateString() : "N/A"}</td>
                    <td>{f.status}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}

        {view === "submitted" && (
          <div>
            <h3>All Submitted Feedbacks</h3>
            <table>
              <thead>
                <tr>
                  <th>Mentor</th>
                  <th>Week</th>
                  <th>Submitted On</th>
                  <th>Status</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {feedbacks.length > 0 ? feedbacks.map(f => (
                  <tr key={f.id}>
                    <td>{f.mentorName}</td>
                    <td>{f.week}</td>
                    <td>{f.submittedOn ? new Date(f.submittedOn).toLocaleDateString() : "N/A"}</td>
                    <td>{f.status}</td>
                    <td>
                      <button className="Trash" onClick={() => handleDelete(f.id)}>
                        <FaTrash />
                      </button>
                    </td>
                  </tr>
                )) : (
                  <tr>
                    <td colSpan="5">No feedbacks submitted yet.</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        )}
      </main>
      {/* ---------------------------------------------------- */}

    </div>
  );
};

export default UserDashboard;
